const axios = require('axios').default;

class Flutterwave {
    constructor() {
        this.flutterwave_payment_link = 'https://api.flutterwave.com/v3/payments';
        this.tx_ref = null;
        this.amount = null;
        this.Authorization = null;
        this.payment_option = null;
        this.redirect_url = 'https://webhook.site/0404b881-7fd3-46bf-9db0-e055c9075a26';
        this.meta = [];
        this.customer = [];
        this.customizations = [];
        this.transaction_id = null;
        this.currency = null;
        this.bank_transfer_image = 'data:image/png;base64,'
        this.CARD_PAYMENT_IMG = 'data:image/png;base64,'
        this.MOBILE_MONEY_PAYMENT_IMG = 'data:image/png;base64,'
    }

    static payment_options = [{
        key: "card",
        label: "Card Payment",
        image: this.CARD_PAYMENT_IMG
    }, {
        key: "banktransfer",
        label: "Bank Transfer",
        image: this.bank_transfer_image
    }, ];

    static payment_options_gh = [{
        key: "card",
        label: "Card Payment",
        image: this.CARD_PAYMENT_IMG
    }, {
        key: "mobilemoneyghana",
        label: "Mobile Money",
        image: this.MOBILE_MONEY_PAYMENT_IMG
    }, {
        key: "banktransfer",
        label: "Bank Transfer",
        image: this.bank_transfer_image
    }, ];

    static payment_options_ng = [{
            key: "card",
            label: "Card Payment",
            image: this.CARD_PAYMENT_IMG
        },
        {
            key: "banktransfer",
            label: "Bank Transfer",
            image: this.bank_transfer_image
        },
    ];

    setCurrency(currency) {
        this.currency = currency;
        return this
    }

    setRefferenceNumber(tx_ref) {
        this.tx_ref = tx_ref;
        return this;
    }

    settransactionId(transaction_id) {
        this.transaction_id = transaction_id;
        return this;
    }

    setTransactionAmount(amount) {
        this.amount = amount;
        return this;
    }

    setRedirectTo(redirect_url) {
        this.redirect_url = redirect_url;
        return this;
    }

    setMetaData($meta) {
        this.meta = $meta;
        return this;
    }

    setAuthorization(Authorization) {
        this.Authorization = Authorization;
        return this;
    }

    setPaymentOption(payment_option) {
        this.payment_option = payment_option;
        return this;
    }

    setCustomer(name = null, email = null, phone = null) {
        if (!name || !email || !phone) {
            throw new Error('name, email and phone number is required');
        }
        this.customer = {
            "email": email,
            "phonenumber": phone,
            "name": name,
        };
        return this;
    }

    setCustomDisplay(title = null, description = null, logo = null) {
        if (!title || !description || !logo) {
            throw new Error('title, description and logo number is required');
        }
        this.customizations = {
            "title": title,
            "description": description,
            "logo": logo,
        }
        return this;
    }

    empty(data) {
        return data === undefined || data === null || !data
    }

    async pay() {
        if (this.empty(this.tx_ref)) {
            throw new Error("refference_number has no data");
        }
        if (this.empty(this.amount)) {
            throw new Error("transaction_amount data is required ");
        }
        if (this.empty(this.payment_option)) {
            throw new Error("payment_option data is required ");
        }
        if (this.empty(this.customer)) {
            throw new Error("customer data is required ");
        }
        if (this.empty(this.customer)) {
            throw new Error("customer data is required ");
        }
        if (this.empty(this.Authorization)) {
            throw new Error("Authorization is required ");
        }

        let amount_to_pay = this.amount;
        let payload = {
            "tx_ref": this.tx_ref,
            "amount": amount_to_pay,
            "currency": this.currency,
            "redirect_url": this.redirect_url,
            "payment_options": this.payment_option,
            "customer": this.customer
        }

        if (this.meta.length > 0) {
            payload.meta = this.meta
        }

        if (this.customizations.length > 0) {
            payload.customizations = this.customizations
        }

        let res = {};

        axios.defaults.headers.common['Authorization'] = `Bearer ${this.Authorization}`
        axios.defaults.headers.common['Content-Type'] = 'application/json'
        await axios.post(this.flutterwave_payment_link, payload)
            .then(function(result) {
                let response = result.data
                if (response.status === "success") {
                    res.success = true
                    res.link = response.data.link
                } else {
                    res.success = false
                    res.message = response.message
                }
            })
            .catch(function(error) {
                console.log(error.response.data)
                res.success = false
                res.message = error.response.data
            });

        return res;
    }

    async verifyTransaction() {
        if (this.empty(this.transaction_id)) {
            throw new Error("transaction_id is required ");
        }

        if (this.empty(this.Authorization)) {
            throw new Error("Authorization is required ");
        }

        let res = {};
        const verify_link = `https://api.flutterwave.com/v3/transactions/${this.transaction_id}/verify`;

        axios.defaults.headers.common['Authorization'] = `Bearer ${this.Authorization}`
        axios.defaults.headers.common['Content-Type'] = 'application/json'
        await axios.get(verify_link)
            .then(function(result) {
                let response = result.data
                if (response.status === "success") {
                    res.success = true
                    res.data = response.data;
                } else {
                    res.success = false
                    res.message = response.message
                }
            })
            .catch(function(error) {
                console.log(error)
                res.success = false
                res.message = error
            });

        return res;
    }
}


module.exports = {
    Flutterwave: Flutterwave
};